Išbandykite šiuos dažnai kylančių problemų sprendimo būdus:
• patikrinkite, ar el. laiškas nebuvo pažymėtas kaip šlamštas arba filtruotas;
• patikrinkite interneto ryšį;
• patikrinkite, ar nurodėte tikslų el. pašto adresą;
• patikrinkite, ar nepasibaigė gautiesiems skirta saugyklos vieta arba kitas su gautųjų nustatymais susijusias problemas.

